/**
 * 力扣：https://leetcode.cn/problems/remove-all-adjacent-duplicates-in-string-ii/description/
 */

let strr = ""
function removeKDuplicates(s: string, k: number): string {
    let arr = Array.from(s);
    let len = arr.length;
    let temp = [];
    function isSame(arr: Array<string>, target: string, k: number) {
        if (arr.length < k - 1) return false;
        for (let index = arr.length - k + 1; index < arr.length; index++) {
            const element = arr[index];
            if (element !== target) return false;
        }
        return true;
    }
    for (let index = 0; index < len; index++) {
        if (temp.length > 0 && isSame(temp, arr[index], k)) {
            for (let index = 0; index < k - 1; index++) {
                temp.pop();
            }
        } else {
            temp.push(arr[index]);
        }
    }
    return temp.join("");
}

console.log(removeKDuplicates(strr, 3));
